import { Route, Routes } from "react-router-dom";
import Landing from "./MainLanding/Landing";
import Prod from "./AllProducts/Prod";
import Laptop from "./AllProducts/Laptop";
import Home from "./AllProducts/Home";
import Console from "./AllProducts/Console";
import Clock from "./AllProducts/Clock";
import Appliances from "./AllProducts/Appliances";
import Computer from "./AllProducts/Pc";
import Tablet from "./AllProducts/Tablet";
function App() {
  return (
    <Routes>
      <Route path="/products/:type" component={ProductListPage} />
      <Route path="/" element={<Landing />} />
      <Route path="/phone" element={<Prod />} />
      <Route path="/tablet" element={<Tablet />} />
      <Route path="/laptop" element={<Laptop />} />
      <Route path="/home" element={<Home />} />
      <Route path="/console" element={<Console />} />
      <Route path="/clock" element={<Clock />} />
      <Route path="/appliances" element={<Appliances />} />
      <Route path="/computer" element={<Computer />} />
    </Routes>
  );
}

export default App;
